full_text:
@EvangAntonaros Ειναι αστειο να καρπωνεσαι νικες ασχετων προς εσενα ανθρωπων. 
Για την ωρα εχεις φαει 2κατραπακιες. 1στις ευρωεκλογες κ 1 στις δημοτικες.
που σας ψωνισε ο καραμαλης κ σας εκανε «νουμερο 2»; Με Τετοια επιτυχια πρεπει να αφησει το βουλευτιλίκι κ να παει στο HR καμιας πολυεθνικης

@bpapapanagiotou Ο Καμινης βγηκε 4ος σε σταυρους στις ευρωεκλογες ενω ειχε απιστευτη στηριξη απο το κομμα.
Αφησε την Αθηνα ενα μαυρο χαλι.
Ως υποψηφιος Προεδρος του Πασοκ πηρε μονοψηφιο ποσοστο.
Κι ομως.
Η Φωφη πεφτει για πολλοστη φορα στα ποδια του.
Γιατι αραγε;

Ο Σταμάτης Μαλέλης, ο λόγος των πολλών προβλημάτων του ΚΙΝΑΛ μιλάει στα #akraia_fainomena.
Να πούμε οτι η Ελιά του Βαγγέλη είχε πάρει πάνω απο 8% σε ευρωεκλογές που ο ΣΥΡΙΖΑ πλειοψήφησε.
Ποιός ειναι ο τωρινός στόχος;
Να γυρίσουν πίσω τα λαμόγια;
Λέτε να γυρίσει κι ο Μπίστης.

@LaoudisD Το δεύτερο στοιχείο ήταν η επίδοση του ΚΙΝΑΛ. Από την κατάρρευση του ΣΥΡΙΖΑ κατάφερε να μην κερδίσει τίποτα. Αντιθέτως μείωσε τις δυνάμεις του σε σχέση με τις Ευρωεκλογές του 2014.

Πηγή: https://t.co/5TpOMsu9s3 
Follow us: @skaigr on Twitter | skaigr on Facebook

