@EvangAntonaros Μετά τις επιτυχημένες προβλέψεις στις ευρωεκλογές για τα ποσοστά των κομμάτων στην Ελλάδα, τώρα... 

και διεθνείς!!! 
🤣😂🤣😂🤣😂🤣😂🤣😂🤣

@vagtsal Συγγνώμη φίλε αλλά με την λογική "ΝΔ-Συριζα το ίδιο" δεν θα προχωρήσει και πολύ το μαγαζί. Ήδη δεν σας βγήκε στις Ευρωεκλογές
Βάλτε μυαλό!
Φιλικά και χωρίς σαρκαστική διάθεση...

@KaminisG Γιατί δεν κατεβαίνεις με σταυρό να τα κάνεις όλα αυτά;
Γιατί πήρες την κρυάδα από τις ευρωεκλογές;
Για 15% αλλά ποτάμι σας κόβω σιγά σιγά

@AnergoTeacher Αγαπητέ,
Ο Βενιζέλος δεν είναι απλός βουλευτής,όπως και ο Καμινης είναι απλός πρρωην δήμαρχος και αποτυχών ευρωβουλευτής!
Θεωρείς ότι το ΠΑΣΟΚ θα συμμετάσχει σε αναθεωρητική Βουλή χωρίς τον Βενιζελο;
Η Φωφη αν είχαμε λίστα ευρωεκλογές θα έβαζε ΝΑΠ και Καμίνη πρώτους,δυστυχώς!

@Kallkall14 @john_wayne_gr Ο Αρναουτάκης βγήκε περιφερειάρχης.
Μιλάω για Ευρωεκλογές στον νομό Χανίων.
Είναι απλό.
